import './Home.css'
const Home = () => {

    useEffect(() => {
      const fetchPrivateDate = async () => {
        const config = {
          headers: {
            "Content-Type": "application/json",
            authorization: `Bearer ${localStorage.getItem("authToken")}`,
          },
        };

        try {
          const { data } = await axios.get("/protected", config);
          console.log(data);
          setPrivateData(data.data);
        } catch (error) {
          localStorage.removeItem("authToken");
          setError("You are not authorized please login");
        }
      };

      fetchPrivateDate();
    }, []);
    return (
        <>
            <div id="body" className="d-flex text-center text-white bg-dark">
                    <div className="cover-container d-flex w-100 h-100 p-3 mx-auto flex-column">
                    <header className="mb-auto">
                        <div>
                            <h3 className="float-md-left mb-0">Project1</h3>
                            <nav className="nav nav-masthead justify-content-center float-md-right">
                                <a className="nav-link active" aria-current="page" href="/">Home</a>
                                <a className="nav-link" href="/protected">Projects</a>
                                <a className="nav-link" href="/login">Login</a>
                                <a className="nav-link" href="/register">Register</a>
                                <a className="nav-link" href="/logout">Logout</a>
                            </nav>
                        </div>
                    </header>
                    <main className="px-3">
                        <h1>Project1</h1>
                        <p className="lead"> Welcome to Project1! Lorem ipsum dolor sit amet.
                            Lorem ipsum dolor sit amet consectetur adipisicing elit.
                            </p>
                        <a href="/" className="btn btn-lg btn-secondary font-weight-bold border-white bg-white">View
                            Projects</a>
                    </main>
                    <footer className="mt-auto text-white-50">
                        <p>&copy; 2021 </p>
                    </footer>
                </div>
            </div>
        </>
    )
}

export default Home
